
// 将在全局初始化一个 mqtt 变量
    //console.log(mqtt);

    // 连接选项
    const options = {
        connectTimeout: 4000, // 超时时间
        // 认证信息
        username: 'ORISONIC',
        password: 'ORISONIC2020',

    };

    // ws是普通通讯，端口8083；wss是加密通讯，端口是8084
    // const client = mqtt.connect('ws://iot.orisonic.com:8083/mqtt', options);
    // const client = mqtt.connect('wss://iot.orisonic.com:8084/mqtt', options);
    // const client = mqtt.connect('ws://192.168.0.41:8083/mqtt', options);
    // const client = mqtt.connect('wss://www.test.com:8084/mqtt', options);
    const client = mqtt.connect('ws://www.yymit.cn:8083/mqtt', options);

    // client.
    client.on('connect', (error) => {
        console.log('链接成功:', error)
    });
    client.on('reconnect', (error) => {
        console.log('正在重连:', error)
    });

    client.on('error', (error) => {
        console.log('连接失败:', error)
    });
    var gw_network_id_list = eval($('#gw-network-id-list').val());
    console.log('gw_network_id_list', gw_network_id_list);
    // 订阅列表
    client.subscribe(gw_network_id_list, { qos: 2 });
    // 监听接收消息事件
    client.on('message', (topic, message) => {
        // console.log('收到来自', topic, '的消息', message.toString());
        var payload = eval("(" + message.toString() + ")");
        var id = payload.id;
        var header = payload.header;
        var msg = payload.msg;
        var status = payload.status;

        if (id === 'client') {
            // console.log('收到来自', topic, '的消息');
            console.log(payload);

            if (header === 'gwdata') {
                var gwntid = rsplit(payload.network_id,'.');
                console.log('gwntid-=====', gwntid);
                if (isInArray(gw_network_id_list, gwntid)){
                    $('#' + header).html(msg);
                }
                if (status) {
                    // ClearMSGAndRefersh('#' + header);
                    setTimeout(function () {
                        $("#gwdata").text('');
                    }, 5000);
                }else{
                    button_sample = false;
                }
            }else if (
                header === 'update_sensor' ||
                header === 'add_sensor' ||
                header === 'remove_sensor'
            ) {
                var gwntid = rsplit(payload.network_id,'.');
                console.log('gwntid-=====', gwntid);
                if (isInArray(gw_network_id_list, gwntid)){
                    $('#' + header).html(msg);
                }
                // if (status){
                //     ClearMSGAndJump('#' + header);
                // }
            }else if (header === 'set_sensor_params') {
                var gwntid = rsplit(payload.network_id,'.');
                console.log('gwntid-=====', gwntid);
                if (isInArray(gw_network_id_list, gwntid)){
                    $('#' + header).html(msg);
                }
                // if (status){
                //     setTimeout(function () {
                //         $('#' + header).text('');
                //         window.location.href="/GWS/edit-sensor-params";
                //     }, 1500);
                // }
            }
        }

    });

    /**
     * 使用循环的方式判断一个元素是否存在于一个数组中
     * @param {Object} arr 数组
     * @param {Object} value 元素值
     */
    function isInArray(arr,value){
        for(var i = 0; i < arr.length; i++){
            if(value === arr[i]){
                return true;
            }
        }
        return false;
    }

    /**
     * 分割字符串，并重组成新的字符串
     * @param {Object} str 字符串
     * @param {Object} separator 分割点
     */
    function rsplit(str,separator){
        var str_list = str.split(separator);
        var gwntid = str_list[0] + '.' + str_list[1] + '.' + str_list[2] + ".0";
        return gwntid
    }

